import react from 'react';
import PropTypes from 'prop-types';

const AppLayout = ({ children }) => (
  <div>
    <div>공통메뉴</div>
    {children}
  </div>
);

AppLayout.prototype = {
  children: PropTypes.node.isRequired,
};

export default AppLayout;
